import React, { Component } from 'react';
import Navbar from 'react-bootstrap/Navbar'
import Nav from 'react-bootstrap/Nav'
import NavDropdown from 'react-bootstrap/NavDropdown'
import Logo from '../assets/img/logow.png'
import '../assets/navbar.css'

class MainNavbar extends Component{
    render(){

        return (
            
              <Navbar className="navbar-collapse nav-color mar-3">
                <Navbar.Brand href="#home" className="nav-color">
                    <img
                        alt="logo"
                        src={Logo}
                        width="30"
                        height="30"
                        className="d-inline-block align-top"
                    />{' '}
                    Planning Car
                </Navbar.Brand>
                <Nav className="ml-auto nav-color">
                    <Nav.Link href="#home" className="nav-color">Home</Nav.Link>
                    <Nav.Link href="#features" className="nav-color">Carros</Nav.Link>
                    <Nav.Link href="#features" className="nav-color">Carros</Nav.Link>
                    <NavDropdown title="Cuenta" id="collasible-nav-dropdown">
                        <NavDropdown.Item href="#">Perfil</NavDropdown.Item>
                        <NavDropdown.Item href="#">Ajustes</NavDropdown.Item>
                        <NavDropdown.Item href="#">Salir</NavDropdown.Item>
                    </NavDropdown>

                    
                </Nav>
                

            </Navbar>
    
        
            
        );
    }
}
export default MainNavbar;
